import React from 'react';
import '../styles/global.css';
import { FaHeart } from "react-icons/fa";

import mylittleDinosaur from '../assets/book-photos/babbies-toddlers/BEDTIME STORIES.png';

const MyWishlist = () => {
    const products = [
        {
            title: 'My Little Dinosaur (Hardcover)',
            price: '₱640.00',
            originalPrice: '₱800.00',
            discount: '-20%',
            label: 'Best Seller',
            image: mylittleDinosaur,
            saleType: 'Sale',
        },
        {
            title: 'My Little Dinosaur (Hardcover)',
            price: '₱640.00',
            originalPrice: '₱800.00',
            discount: '-20%',
            label: 'Best Seller',
            image: mylittleDinosaur,
            saleType: 'Sale',
        },
        {
            title: 'My Little Dinosaur (Hardcover)',
            price: '₱640.00',
            originalPrice: '₱800.00',
            discount: '-20%',
            label: 'Best Seller',
            image: mylittleDinosaur,
            saleType: 'Sale',
        },
    ];

    const styles = {
        productCardWrapper: {
            display: 'flex',
            justifyContent: 'center',
            width: '100%',
        },
        productCard: {
            margin: 0,
            flexShrink: 0,
            width: '300px',
            height: '500px',
            maxWidth: '300px',
            border: '1px solid #757575',
            padding: '45px 30px 20px 30px',
            textAlign: 'left',
            backgroundColor: '#fff',
            position: 'relative',
            display: 'flex',
            flexDirection: 'column',
            justifyContent: 'space-evenly',
            boxSizing: 'border-box',
            transition: 'border 0.3s ease, box-shadow 0.3s ease',
        },
        labels: {
            position: 'absolute',
            fontFamiliy: 'Rethink Sans',
            top: '10px',
            left: '10px',
            display: 'flex',
            flexDirection: 'column',
            gap: '10px',
            zIndex: '2',
        },
        saleLabel: {
            backgroundColor: '#920000',
            textTransform: 'uppercase',
            textAlign: 'left',
            color: '#fff',
            fontFamiliy: 'Rethink Sans',
            fontSize: '1rem',
            fontWeight: 'bold',
            padding: '5px 0 5px 15px',
            width: '75px',
            marginLeft: '-10px',
        },
        badgeLabel: {
            textTransform: 'uppercase',
            color: '#fff',
            fontFamiliy: 'Rethink Sans',
            fontSize: '1rem',
            fontWeight: 'bold',
            padding: '5px 20px 5px 15px',
            marginLeft: '-10px',
        },
        heartWrapper: {
            position: 'absolute',
            top: '20px',
            right: '-150px',
            cursor: 'pointer',
        },
        wishlistIcon: {
            fontSize: '15px',
            color: '#000',
        },
        productImage: {
            width: '100%',
            height: '300px',
            objectFit: 'cover',
            border: '2px solid #000',
        },
        title: {
            fontSize: '1rem',
            fontWeight: 'bold',
            fontFamiliy: 'Rethink Sans',
            margin: '10px 0 5px',
        },
        productAuthor: {
            fontSize: '0.9rem',
            fontFamiliy: 'Rethink Sans',
            color: '#757575',
            marginBottom: '10px',
        },
        productPrice: {
            fontSize: '1rem',
            fontFamiliy: 'Rethink Sans',
        },
        currentPrice: {
            fontWeight: 'bold',
            fontFamiliy: 'Rethink Sans',
            color: '#000',
            marginRight: '5px',
        },
        originalPrice: {
            fontFamiliy: 'Rethink Sans',
            fontSize: '13px',
            color: '#9e9e9e',
            textDecoration: 'line-through',
            marginRight: '5px',
        },
        discount: {
            fontFamiliy: 'Rethink Sans',
            fontSize: '13px',
            color: '#d32f2f',
            fontWeight: 'bold',
            marginLeft: '10px',
        },
    };

    return (
        <div>
            
        </div>
    );
};

export default MyWishlist;
